    /**
     * 返回身份证所在城市
     * @param string $idc
     * @return string
     */
    public function get_city($idc) {
        $idc = $_POST['idc'];
        $idc = substr($idc, 0, 6);
        $idc = substr(md5($idc), 8, 16);
        return isset(self::$cityinfo[$idc]) ? self::$cityinfo[$idc] : null;
    }

    /**
     * 检查身份证号码性别
     * @param string $idc
     * @return string 男|女
     */
    function get_sex($idc) {
        $idclen = strlen($idc);
        if (15 == $idclen) {
            if (0 <> $idc[$idclen - 1] % 2) {
                return "男";
            } else {
                return "女";
            }
        } elseif (18 == $idclen) {
            if (0 <> $idc[$idclen - 2] % 2) {
                return "男";
            } else {
                return "女";
            }
        }
    }

    /**
     * 检查合法身份证号码
     * @param string $e
     * @return boolean
     */
    public function check($e) {
        $arrVerifyCode = explode(",", "1,0,x,9,8,7,6,5,4,3,2");
        $Wi = explode(",", "7,9,10,5,8,4,2,1,6,3,7,9,10,5,8,4,2");
        $Checker = explode(",", "1,9,8,7,6,5,4,3,2,1,1");
        If (strlen($e) < 15 || strlen($e) == 16 || strlen($e) == 17 || strlen($e) > 18)
            return false;
        if (strlen($e) == 18) {
            $ai = substr($e, 0, 17);
        } elseIf (strlen($e) == 15) {
            $ai = $e;
            $ai = substr($ai, 0, 6) & "19" & substr($ai, 6, 9);
        }
        $strYear = substr($ai, 7, 4);
        $strMonth = substr($ai, 11, 2);
        $strDay = substr($ai, 13, 2);
        if (checkdate($strMonth, $strDay, $strYear))
            return false;
        for ($i = 0; $i < 17; $i++) {
            $TotalmulAiWi += substr($ai, $i, 1) * $Wi[$i];
        }
        $modValue = $TotalmulAiWi % 11;
        $strVerifyCode = $arrVerifyCode[$modValue];
        $ai .= $strVerifyCode;
        If (strlen($e) == 18 && $e <> $ai)
            return false;
        return $ai;
    }

